import React from 'react';
import { makeStyles } from '@material-ui/styles';
import { Grid, Hidden } from '@material-ui/core';

import {
  Budget,
  TotalUsers,
  TasksProgress,
  TotalProfit,
  LatestSales,
  UsersByDevice,
  LatestProducts,
  LatestOrders,
  Filter
} from './components';

const useStyles = makeStyles(theme => ({
  root: {
    padding: theme.spacing(0), width: 800
  }
}));

const PropertySearch = () => {
  const classes = useStyles(); 
  const isDesktop = 0;
  if(isDesktop == 0){
    return (
        <div className={classes.root}>
            <Filter style={{padding:0}}></Filter>
          <Grid
            container
            spacing={4}
          >
            <Grid
              item
              lg={3}
              sm={6}
              xl={3}
              xs={12}

            >
              <Budget />
            </Grid>
            <Grid
              item
              lg={3} 
              sm={6}
              xl={3}
              xs={12}
            >
              <TotalUsers />
            </Grid>
            <Grid
              item
              lg={3}
              sm={6}
              xl={3}
              xs={12}
            >
              <TasksProgress />
            </Grid>
            <Grid
              item
              lg={3}
              sm={6}
              xl={3}
              xs={12}
            >
              <TotalProfit />
            </Grid>
            <Grid
              item
              lg={8}
              md={12}
              xl={9}
              xs={12}
            >
              <LatestSales />
            </Grid>
            <Grid
              item
              lg={4}
              md={6}
              xl={3}
              xs={12}
            >
              <UsersByDevice />
            </Grid>
            <Grid
              item
              lg={4}
              md={6}
              xl={3}
              xs={12}
            >
              <LatestProducts />
            </Grid>
            <Grid
              item
              lg={8}
              md={12}
              xl={9}
              xs={12}
            >
              <LatestOrders />
            </Grid>
          </Grid>
        </div>
      );
  } else {
      return(
          <div></div>
      );
  }

};

export default PropertySearch;
